import React from "react";

 import './Card.css'

export default function Card ({info}){


    return(
        <>
         

         {info.map((card,index)=>(
            <div className="bigContainar"> 

          <div  key ={index}className="card">

           <h1>{card.clinic}</h1>
           </div>
         </div> 
         ))}
        

        
        </>
    )
}
